import React from 'react';
import {
    Box,
    Grid2,
    Typography,
    Container,
    Button,
    Paper
} from '@mui/material';

import FormText2Image from '../components/FormText2Image.js';

const Text2Image = () => {
    return (
        <Container maxWidth='xxl' sx={{ py: 6 }}>
            <Grid2 container spacing={2}>
                <Grid2 size={{ xs: 12, md: 6 }}>
                    <Paper eelevation={0}>
                        <FormText2Image />
                    </Paper>
                </Grid2>
                <Grid2 size={{ xs: 12, md: 6 }}>
                    Hello
                </Grid2>
            </Grid2>
        </Container>
    )
}

export default Text2Image
